import React from 'react';

import './styles.css'

interface HomeItemProps{
  title: string;
  paragraph: string;
}

const HomeItem: React.FC<HomeItemProps> = (props) => {
  return(
    <article className="home-item">
      <header>
        <div>
          <strong>{props.title}</strong>
        </div>
      </header>
          <p> {props.description}</p>
    </article>
  )
}

export default HomeItem;
